import {GetAllProject} from '../HuddleComponents/GetAllProjects.js';
import {GetAllMemberDevelopers} from '../HuddleComponents/GetAllMemberDevelopers.js';
import {useState} from 'react';
export const NewTicktForm = () => {
    const [ticketTitle, setTitleInputValue] = useState("");
    // Input Field handler
    const handleTicketTitle = (e) => {
        setTitleInputValue(e.target.value);
    };
    // Reset Input Field handler
    const resetserachAreaInput = () => {
        setSearchAreaInputVal("");
    };
    let formDivStyle = {
        overflow: "hidden",
        marginRight : "30px" , 
        marginTop: "15px"     
    }
    let textAreaCss = {
        minHeight : "100px"
    }
    return (
        <div style={formDivStyle}>
        <form className="row g-3">
            <div className="col-12">
                <label htmlFor="inputTitle" className="form-label">Title</label>
                <input type="text" className="form-control" id="inputTitle" placeholder="Please enter the ticket title" />
            </div>
            <div className="col-12">
                <label htmlFor="inputDescription" className="form-label">Description</label>
                <textarea style= {textAreaCss} className="form-control" id="inputDescription" placeholder="Enter description here" />
            </div>
            <div className="col-12">
                <label htmlFor="inputAcceptanceCriteria" className="form-label">Acceptance Criteria</label>
                <textarea style= {textAreaCss} className="form-control" id="inputAcceptanceCriteria" placeholder="Enter acceptance criteria" />
            </div>
            <div className="col-md-4">
                <label htmlFor="inputAssignTo" className="form-label">Assign to</label>
                <GetAllMemberDevelopers bucketNameDropdown={true}/>
            </div>
            <div className="col-md-4">
                <label htmlFor="inputBucket" className="form-label">Bucket</label>
                <GetAllProject bucketNameDropdown={true}/>
            </div>
            <div className="col-12">
                <button type="submit" className="btn btn-primary">Submit</button>
            </div>

        </form>
        </div>

    )
}
